We apply the CYK algorithm.  First, which nonterminals produce each single token?  
  t58  ∈ {NT17, NT22}  
  t2   ∈ {NT18, NT43}  
  t110 ∈ {NT11}  
  t17  ∈ {NT15}  

Next, length‑2 spans:

 positions 1–2: pairs (NT17,NT18), (NT17,NT43), (NT22,NT18), (NT22,NT43).  No binary rule A→BC matches any of these four.  
 positions 2–3: pairs (NT18,NT11), (NT43,NT11).  No rule A→BC matches either.  
 positions 3–4: pair (NT11,NT15).  No rule A→BC matches that either.  

Thus no nonterminal covers any span of length 2, so the start symbol S cannot build the length‑4 string.  

