A quick CYK‐style check shows that no matter how you build up the five terminals t72 t118 t33 t80 t30 from the binary rules, you never end up with S covering all five positions. In particular, the only nonempty entries of the table for spans of length ≥2 are

  span 1–2 ⇒ {NT20}  
  span 2–3 ⇒ {NT32}  
  span 3–4 ⇒ {NT5, NT30}  
  span 4–5 ⇒ {NT5}  
  span 1–3 ⇒ {NT23}  
  span 3–5 ⇒ {S}  

and no combination of these ever yields S over the entire 1–5 span. Therefore the string is not generated by the grammar.  

