When you try to build longer spans (length 2, 3, … 6) by combining adjacent shorter spans, you look for rules X → Y Z with Y in the left cell and Z in the right.  Exhaustively scanning those pairs against the grammar produces no way to reach S over the full span (1–6).  In particular no sequence of binary productions connects our leaves up to S.  

Hence the grammar does not generate the string.  

